import { useEffect, useState } from 'react';

function Hello() {
    useEffect(() => {}, []);
    return (
        <>
            <h1>Hello</h1>
        </>
    );
}

function App() {
    const [showing, setShowing] = useState(false);
    const onClick = () => {
        setShowing((prev) => !prev);
    };
    console.log(showing);
    return (
        <div>
            {showing ? <Hello /> : null}
            <button onClick={onClick}>{showing ? 'Hide' : 'Show'}</button>
        </div>
    );
}

export default App;
